var map = L.map('map', {
    center: [center_EXT_lat, center_EXT_lon],
    zoomSnap: 0.25,
    zoom: 10.25,
    zoomControl: false
    //renderer: L.canvas({tolerance: 5})
});


var a_osmlayer = L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
attribution: '@ <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors',
}).addTo(map);

var googleSat = L.tileLayer('http://{s}.google.com/vt/lyrs=s&x={x}&y={y}&z={z}',{
    maxZoom: 20,
    minZoom: 2,
    subdomains:['mt0','mt1','mt2','mt3']
});

//var ext_orig = L.featureGroup();

map.createPane('bottom_label_1');
map.getPane('bottom_label_1').style.zIndex = 250;

var myStyle_1 = {
    "color": "#808080",
    "fillColor": "#ffffff",
    "weight": 1,
    "opacity": 0.75,
    "fillOpacity": 0.4
};

function highlightFeature(e) {
var layer = e.target;

layer.setStyle({
    weight: 5,
    color: 'red',
});

if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
    layer.bringToFront();
}

//info.update(layer.feature.properties);
}

function resetHighlight(e) {
base_sector_layer.resetStyle(e.target);
//info.update();
}

function zoomToFeature(e) {
map.fitBounds(e.target.getBounds());
}


var base_sector_layer = L.geoJSON(json_SECTORgeo, {
style: myStyle_1,
pane: 'bottom_label_1',
onEachFeature: function (feature, layer) {
    layer.on({
        mouseover: highlightFeature,
        mouseout: resetHighlight,
        click: zoomToFeature
    });
}
}).bindTooltip(function (layer) {
return "SECTOR ID: " + layer.feature.properties.SECTOR; //merely sets the tooltip text
}, {offset: [15, 5], sticky: true}  //then add your options
).addTo(map);



// since this demo is using the optional "pathDisplayMode" as "selection",
// it is up to the developer to wire up a click or mouseover listener
// and then call the "selectFeaturesForPathDisplay()" method to inform the layer
// which Bezier paths need to be drawn


var basemaps_1 = {
"Open Street Map": a_osmlayer,
"Google Satellite Map": googleSat
};

var overlaymaps_1 = {
"Sector Layer": base_sector_layer
};

L.control.layers(basemaps_1, overlaymaps_1).addTo(map);
L.control.scale().addTo(map);


// immediately select an origin point for Bezier path display,
// instead of waiting for the first user click event to fire

//oneToManyFlowmapLayer.selectFeaturesForPathDisplayById('fid', 10, true, 'SELECTION_NEW');
//oneToManyFlowmapLayer_2.selectFeaturesForPathDisplayById('fid_2', 10, true, 'SELECTION_NEW');



// Fetch the JSON file
fetch('data.json')
    .then(response => response.json())
    .then(data => {
    // Get the dropdown element
    const dropdown = document.getElementById('myDropdown');

    // Clear existing options
    dropdown.innerHTML = '';

    // Loop through the data and create options
    data.forEach(item => {
        const option = document.createElement('option');
        option.value = item.value;
        option.text = item.text;
        dropdown.appendChild(option);
    });
    })
    .catch(error => {
    console.error('Error:', error);
    });